import React, { useEffect, useState } from 'react';
import "../../styles/Profile.css";
import DoctorNavbar from '../../components/DoctorNavbar';
import DoctorFooter from '../../components/DoctorFooter';
import SampleIcon from '../../assets/DoctorIcons/Icon01.png';
import { Calendar, dateFnsLocalizer } from 'react-big-calendar';
import format from 'date-fns/format';
import parse from 'date-fns/parse';
import startOfWeek from 'date-fns/startOfWeek';
import getDay from 'date-fns/getDay';
import "react-big-calendar/lib/css/react-big-calendar.css";
import { Link } from 'react-router-dom';
import avatar00 from '../../images/profilepic.jpg';
import avatar01 from '../../assets/DoctorIcons/Icon01.png';
import avatar02 from '../../assets/DoctorIcons/Icon02.png';
import avatar03 from '../../assets/DoctorIcons/Icon03.png';
import avatar04 from '../../assets/DoctorIcons/Icon04.png';
import avatar05 from '../../assets/DoctorIcons/Icon05.png';
import avatar06 from '../../assets/DoctorIcons/Icon06.png';
import avatar07 from '../../assets/DoctorIcons/Icon07.png';
import avatar08 from '../../assets/DoctorIcons/Icon08.png';
import avatar09 from '../../assets/DoctorIcons/Icon09.png';
import avatar10 from '../../assets/DoctorIcons/Icon10.png';
import avatar11 from '../../assets/DoctorIcons/Icon11.png';
import avatar12 from '../../assets/DoctorIcons/Icon12.png';
import avatar13 from '../../assets/DoctorIcons/Icon13.png';
import avatar14 from '../../assets/DoctorIcons/Icon14.png';

const DoctorProfile = () => {
    const [avatar, setAvatar] = useState('');
    const [selectedAvatar, setSelectedAvatar] = useState('');
    const [user, setUser] = useState(null);
    const [isError, setIsError] = useState(false);
    const [doctorUserId, setDoctorUserId] = useState('');
    const [appointments, setAppointments] = useState([
      {
        title: '',
        start: new Date(),
        end: new Date(),  // 5:00 PM
        appointmentId: '',
        appointmentStatus: ''
      },
    ]);
  
    useEffect(() => {
        fetchUser();
      }, []);

    const fetchUser = async () => {
        try {
          const response = await fetch("http://localhost:8080/doctorprofile");
          if (response.ok) {
            const data = await response.json();
            setUser(data);
            setAvatar(data.user.avatar)
          } else {
            setIsError(true);
          }
        } catch (error) {
          console.error('Error fetching user:', error);
          setIsError(true);
        }
    };


    const setDisplayedAvatars = (avatar) => {
      switch (avatar) {
      case 'avatar01':
          setSelectedAvatar(avatar01);
      case 'avatar02':
          setSelectedAvatar(avatar02);
      case 'avatar03':
          setSelectedAvatar(avatar03);
      case 'avatar04':
          setSelectedAvatar(avatar04);
      case 'avatar05':
          setSelectedAvatar(avatar05);
      case 'avatar06':
          setSelectedAvatar(avatar06);
      case 'avatar07':
          setSelectedAvatar(avatar07);
      case 'avatar08':
          setSelectedAvatar(avatar08);
      case 'avatar09':
          setSelectedAvatar(avatar09);
      case 'avatar10':
          setSelectedAvatar(avatar10);
      case 'avatar11':
          setSelectedAvatar(avatar11);
      case 'avatar12':
          setSelectedAvatar(avatar12);
      case 'avatar13':
          setSelectedAvatar(avatar13);
      case 'avatar14':
          setSelectedAvatar(avatar14);
      default:
          setSelectedAvatar(avatar00);
      }
  };

    useEffect(() => {
      // Replace 'http://localhost:8080' with your actual API URL
      fetch('http://localhost:8080/checkLoggedInDoctor')
        .then((response) => {
          if (response.ok) {
            return response.json();
          }
          throw new Error('Network response was not ok');
        })
        .then((data) => {
          setDoctorUserId(data);
          // Once you have the patientUserId, make another request to get appointments
          fetch(`http://localhost:8080/appointments?doctorUserId=${data}`)
            .then((appointmentsResponse) => {
              if (appointmentsResponse.ok) {
                return appointmentsResponse.json();
              }
              throw new Error('Network response was not ok');
            })
            .then((appointmentsData) => {
              const formattedAppointments = appointmentsData.map((appointment) => {
                // Extract date and time components
                const [year, month, day] = appointment.scheduleDate.split('-').map(Number);
                const [hours, minutes] = appointment.startTime.split(':').map(Number);
                const [hours2, minutes2] = appointment.endTime.split(':').map(Number);
  
                // Create Date objects for start and end times
                const startDate = new Date(year, month - 1, day, hours, minutes);
                const endDate = new Date(year, month - 1, day, hours2, minutes2);
  
                // Create an appointment object
                return {
                  title: appointment.patientName,
                  start: startDate,
                  end: endDate,
                  appointmentId: appointment.transactionNo,
                  appointmentStatus: appointment.status
                };
              });
  
              setAppointments(formattedAppointments);
            })
            .catch((error) => {
              // Handle errors
              console.error(error);
            });
  
        })
        .catch((error) => {
          setIsError(true);
          console.error('Error:', error);
        });
    }, []);
  
    const locales = {
      "en-US": require("date-fns/locale/en-US")
    }
  
    const localizer = dateFnsLocalizer({
      format,
      parse,
      startOfWeek,
      getDay,
      locales
    })
  
    const handleCancel = async (appointmentId) => {
      try {
        const response = await fetch(`http://localhost:8080/appointmentChange/${appointmentId}?newStatus=Cancelled`, {
          method: 'PUT',
        });
  
        if (response.ok) {
          // Handle success if needed
          console.log('Appointment cancelled successfully');
          window.location.reload();
        } else {
          setIsError(true);
        }
      } catch (error) {
        console.error('Error cancelling appointment:', error);
        setIsError(true);
      }
    };

    return (
      <div className="profile-container" id="container">
          <DoctorNavbar />
          <div className="doctorprofilecontainer">
              {user ? (
                  <div className="parentelement">
                      <div className="columns" id="columnprofileicon">
                          <div className="backgroundpop"></div>
                          <div className="doctorprofileicon">
                          {selectedAvatar && <img src={selectedAvatar} alt="Selected Avatar" />}
                          </div>
                          <div className="doctorprofilename">
                              <p className="pn">
                              <b>{user.user.firstName} {user.user.middleName} {user.user.lastName}</b>
                              </p>
                          </div>
                          <div className="doctorprofiletitle">
                              <p className="pt">
                              <i>{user.credentials}</i>
                              </p>
                          </div>
                          <div className="listofdocprofilecontent">
                              <ul>
                                  <li><a href="#">View Profile</a></li>
                                  <li><a href="#">View Profile</a></li>
                                  <li><a href="#">View Profile</a></li>
                                  <li><a href="#">View Profile</a></li>
                              </ul>
                          </div>
                      </div>
                      <div className="columns" id="columnprofileinformation">
                          <div className="doctorprofilecontent">
                              <div className="mydoctorprofileaccount">
                                  <div className="backgroundpop">
                                      <div className="doctorprofilecontenttitles">
                                          <p><b>ACCOUNT</b></p>
                                      </div>
                                      <div className="contentcolumn">
                                          <div className="contentcolumn1">
                                              <div className="contentrow">
                                                  <div className="dataname">
                                                      <p>Username: </p>
                                                  </div>
                                                  <div className="datainfo">
                                                      {user.user.username}
                                                  </div>
                                              </div>
                                          </div>
                                          <div className="contentcolumn2">
                                              <div className="contentrow">
                                                  <div className="dataname">
                                                      <p>Email: </p>
                                                  </div>
                                                  <div className="datainfo">
                                                      {user.user.email}
                                                  </div>
                                              </div>
                                          </div>
                                      </div>
                                  </div>
                              </div>
                              <div className="mydoctorprofilepersonal">
                                  <div className="backgroundpop">
                                      <div className="doctorprofilecontenttitles">
                                          <p><b>PERSONAL INFORMATION</b></p>
                                      </div>
                                      <div className="contentcolumn">
                                          <div className="contentcolumn1">
                                              <div className="contentrow">
                                                  <div className="dataname">
                                                      <p>Sex: </p>
                                                  </div>
                                                  <div className="datainfo">
                                                      {user.user.sex}
                                                  </div>
                                              </div>
                                          </div>
                                          <div className="contentcolumn2">
                                              <div className="contentrow">
                                                  <div className="dataname">
                                                      <p>Age: </p>
                                                  </div>
                                                  <div className="datainfo">
                                                      {user.user.age}
                                                  </div>
                                              </div>
                                          </div>
                                          <div className="contentcolumn2">
                                              <div className="contentrow">
                                                  <div className="dataname">
                                                      <p>Birthday: </p>
                                                  </div>
                                                  <div className="datainfo">
                                                      {user.user.birthday}
                                                  </div>
                                              </div>
                                          </div>
                                          <div className="contentcolumn2">
                                              <div className="contentrow">
                                                  <div className="dataname">
                                                      <p>Contact Number: </p>
                                                  </div>
                                                  <div className="datainfo">
                                                      {user.user.contactNumber}
                                                  </div>
                                              </div>
                                          </div>
                                          <div className="contentcolumn2">
                                              <div className="contentrow">
                                                  <div className="dataname">
                                                      <p>Address: </p>
                                                  </div>
                                                  <div className="datainfo">
                                                      {user.user.address}
                                                  </div>
                                              </div>
                                          </div>
                                      </div>
                                  </div>
                              </div>
                              <div className="mydoctorprofilecredentials">
                                  <div className="backgroundpop">
                                      <div className="doctorprofilecontenttitles">
                                          <p><b>CREDENTIALS</b></p>
                                      </div>
                                      <div className="contentcolumn">
                                          <div className="contentcolumn1">
                                              <div className="contentrow">
                                                  <div className="dataname">
                                                      <p>Credentials: </p>
                                                  </div>
                                                  <div className="datainfo">
                                                      {user.credentials}
                                                  </div>
                                              </div>
                                          </div>
                                          <div className="contentcolumn2">
                                              <div className="contentrow">
                                                  <div className="dataname">
                                                      <p>Specialization: </p>
                                                  </div>
                                                  <div className="datainfo">
                                                      {user.specialization}
                                                  </div>
                                              </div>
                                          </div>
                                          <div className="contentcolumn2">
                                              <div className="contentrow">
                                                  <div className="dataname">
                                                      <p>PRC ID No: </p>
                                                  </div>
                                                  <div className="datainfo">
                                                      {user.prcId}
                                                  </div>
                                              </div>
                                          </div>
                                      </div>
                                  </div>
                              </div>
                              <div className="mydoctorprofilesecretary">
                                  <div className="backgroundpop">
                                      <div className="doctorprofilecontenttitles">
                                          <p><b>SECRETARY</b></p>
                                      </div>
                                      <div className="contentcolumn">
                                          <div className="contentcolumn1">
                                              <div className="contentrow">
                                                  <div className="dataname">
                                                      <p>Name: </p>
                                                  </div>
                                                  <div className="datainfo">
                                                      NAME PLACEHOLDER
                                                  </div>
                                              </div>
                                          </div>
                                          <div className="contentcolumn2">
                                              <div className="contentrow">
                                                  <div className="dataname">
                                                      <p>Contact Number: </p>
                                                  </div>
                                                  <div className="datainfo">
                                                      CONTACT NUMBER PLACEHOLDER
                                                  </div>
                                              </div>
                                          </div>
                                          <div className="contentcolumn2">
                                              <div className="contentrow">
                                                  <div className="dataname">
                                                      <p>Email: </p>
                                                  </div>
                                                  <div className="datainfo">
                                                      EMAIL PLACEHOLDER
                                                  </div>
                                              </div>
                                          </div>
                                      </div>
                                  </div>
                              </div>
                          </div>
                      </div>
                      <div className="columns" id="columnprofileappointments" style={{marginTop: "20.8%"}}>
                          <div className="futureappointments">
                              <div className="doctorappoinmentcard">
                                  <div className="backgroundpop">
                                      <div className="titleappointment">
                                          <p><b>CALENDAR</b></p>
                                      </div>
                                      <div className="doctorcalendar">
                                      <Calendar
                                          localizer={localizer}
                                          events={appointments}
                                          startAccessor="start"
                                          endAccessor="end"
                                          style={{ height: 300, width: "84%" }}
                                        />
                                      </div>
                                  </div>
                              </div>
                          </div>
                      </div>
                  </div>
              ) : (
              isError ? (
                      <p>Error fetching user profile</p>
                  ) : (
                      <p>Loading user profile...</p>
                  )
              )}
          </div>
          <DoctorFooter />
      </div>
    );
};

export default DoctorProfile;
